import React from "react";

export default function Header() {
  return (
    <>
      <div className="header-container">
        <div className="header-content">
          <ul>
            <li>
              <a>Thêm thông tin</a>
            </li>
            <li>
              <a>Tra cứu thông tin</a>
            </li>
          </ul>
        </div>
      </div>
    </>
  );
}
